INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 106001, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 7, 7001, 0, "キャル", "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 105901, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 7, 7002, 0, "コッコロ", "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 105801, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 7, 7003, 0, "ペコリーヌ", "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 105801, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 10, 10001, 0, "ペコリーヌ", "ジュエルを食べ物…\nいえ、貴重品と交換できます！");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 106001, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 10, 10002, 0, "キャル", "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 105901, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 10, 10003, 0, "コッコロ", "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 106401, 1, "2030/12/17 14:59:59", 0.0, 1, 2, "2015/12/17 15:00:00", -363.0, 0, 10, 10004, 2104010, "シェフィ", "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 105801, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -416.5, 0, 12, 12001, 0, "ペコリーヌ", "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 106001, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 13, 13001, 0, "キャル", "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 105901, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 13, 13002, 0, "コッコロ", "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 106401, 1, "2030/12/17 14:59:59", 0.0, 1, 2, "2015/12/17 15:00:00", -363.0, 0, 13, 13003, 2104010, "シェフィ", "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 105801, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 13, 13004, 0, "ペコリーヌ", "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 105901, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 14, 14001, 0, "コッコロ", "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 106401, 1, "2030/12/17 14:59:59", 0.0, 1, 2, "2015/12/17 15:00:00", -363.0, 0, 14, 14002, 2104010, "シェフィ", "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 105801, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 14, 14003, 0, "ペコリーヌ", "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 106001, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 14, 14004, 0, "キャル", "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 105901, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -470.0, 0, 15, 15001, 0, "コッコロ", "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 106401, 1, "2030/12/17 14:59:59", 0.0, 1, 2, "2015/12/17 15:00:00", -363.0, 0, 16, 16001, 2104010, "シェフィ", "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 105801, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 16, 16002, 0, "ペコリーヌ", "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 106001, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 16, 16003, 0, "キャル", "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 105901, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 16, 16004, 0, "コッコロ", "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 105901, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 17, 17002, 0, "コッコロ", " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 106001, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 25, 17004, 0, "キャル", "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 105901, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 25, 17005, 0, "コッコロ", "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 106401, 1, "2030/12/17 14:59:59", 0.0, 1, 2, "2015/12/17 15:00:00", -363.0, 0, 25, 17006, 2104010, "シェフィ", "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 105801, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 25, 17007, 0, "ペコリーヌ", "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 190801, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 18, 18001, 0, "カリン", "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 190801, 1, "2030/12/17 14:59:59", 0.0, 2, 1, "2015/12/17 15:00:00", -363.0, 0, 18, 18002, 0, "カリン", "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 190801, 1, "2030/12/17 14:59:59", 0.0, 3, 1, "2015/12/17 15:00:00", -470.0, 0, 19, 19001, 0, "カリン", "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 190801, 1, "2030/12/17 14:59:59", 0.0, 4, 1, "2015/12/17 15:00:00", -470.0, 0, 19, 19002, 0, "カリン", "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 190801, 1, "2030/12/17 14:59:59", 0.0, 5, 1, "2015/12/17 15:00:00", -470.0, 0, 20, 20001, 0, "カリン", "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 190801, 1, "2030/12/17 14:59:59", 0.0, 6, 1, "2015/12/17 15:00:00", -470.0, 0, 20, 20002, 0, "カリン", "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 106001, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 21, 21001, 0, "キャル", "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 105901, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 21, 21002, 0, "コッコロ", "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 106401, 1, "2030/12/17 14:59:59", 0.0, 1, 2, "2015/12/17 15:00:00", -363.0, 0, 21, 21003, 2104010, "シェフィ", "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 105801, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 21, 21004, 0, "ペコリーヌ", "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 190801, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -430.0, 0, 22, 22001, 0, "カリン", "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 190801, 1, "2030/12/17 14:59:59", 0.0, 2, 1, "2015/12/17 15:00:00", -430.0, 0, 22, 22002, 0, "カリン", "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 190801, 1, "2030/12/17 14:59:59", 0.0, 3, 1, "2015/12/17 15:00:00", -430.0, 0, 23, 23001, 0, "カリン", "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 190801, 1, "2030/12/17 14:59:59", 0.0, 4, 1, "2015/12/17 15:00:00", -430.0, 0, 23, 23002, 0, "カリン", "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (8.0, 109001, 2, "2030/12/17 14:59:59", 4.08, 1, 1, "2019/01/31 12:00:00", -385.0, 10011, 24, 24001, 0, "エリコ（バレンタイン）", "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (8.0, 109001, 2, "2030/12/17 14:59:59", 5.0, 2, 1, "2019/01/31 12:00:00", -385.0, 10011, 24, 24002, 0, "エリコ（バレンタイン）", "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (8.0, 109001, 2, "2030/12/17 14:59:59", 10.11, 3, 1, "2019/01/31 12:00:00", -385.0, 10011, 24, 24003, 0, "エリコ（バレンタイン）", "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (8.0, 109001, 2, "2030/12/17 14:59:59", 4.0, 4, 1, "2019/01/31 12:00:00", -385.0, 10011, 24, 24004, 0, "エリコ（バレンタイン）", "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (8.0, 109001, 2, "2030/12/17 14:59:59", 6.0, 5, 1, "2019/01/31 12:00:00", -385.0, 10011, 24, 24005, 0, "エリコ（バレンタイン）", "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 109002, 1, "2030/12/17 14:59:59", 0.0, 6, 1, "2019/01/31 12:00:00", 0.0, 10011, 24, 24006, 0, "エリコ（バレンタイン）", "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 109002, 1, "2030/12/17 14:59:59", 0.0, 7, 1, "2019/01/31 12:00:00", 0.0, 10011, 24, 24007, 0, "エリコ（バレンタイン）", "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 109002, 1, "2030/12/17 14:59:59", 0.0, 8, 1, "2019/01/31 12:00:00", 0.0, 10011, 24, 24008, 0, "エリコ（バレンタイン）", "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 109002, 1, "2030/12/17 14:59:59", 0.0, 9, 1, "2019/01/31 12:00:00", 0.0, 10011, 24, 24009, 0, "エリコ（バレンタイン）", "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 109002, 1, "2030/12/17 14:59:59", 0.0, 10, 1, "2019/01/31 12:00:00", 0.0, 10011, 24, 24010, 0, "エリコ（バレンタイン）", "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (8.0, 109101, 2, "2030/12/17 14:59:59", 2.12, 1, 1, "2019/01/31 12:00:00", -385.0, 10011, 24, 24011, 0, "シズル（バレンタイン）", "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (8.0, 109101, 2, "2030/12/17 14:59:59", 4.19, 2, 5, "2019/01/31 12:00:00", -385.0, 10011, 24, 24012, 0, "シズル（バレンタイン）", "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (8.0, 109101, 4, "2030/12/17 14:59:59", 2.3, 3, 2, "2019/01/31 12:00:00", -385.0, 10011, 24, 24013, 0, "シズル（バレンタイン）", "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 109102, 1, "2030/12/17 14:59:59", 0.0, 4, 1, "2019/01/31 12:00:00", 0.0, 10011, 24, 24014, 0, "シズル（バレンタイン）", "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (8.0, 109101, 2, "2030/12/17 14:59:59", 5.23, 5, 5, "2019/01/31 12:00:00", -385.0, 10011, 24, 24015, 0, "シズル（バレンタイン）", "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 109102, 1, "2030/12/17 14:59:59", 0.0, 6, 1, "2019/01/31 12:00:00", 0.0, 10011, 24, 24016, 0, "シズル（バレンタイン）", "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (8.0, 109101, 2, "2030/12/17 14:59:59", 5.01, 7, 1, "2019/01/31 12:00:00", -385.0, 10011, 24, 24017, 0, "シズル（バレンタイン）", "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 109102, 1, "2030/12/17 14:59:59", 0.0, 8, 1, "2019/01/31 12:00:00", 0.0, 10011, 24, 24018, 0, "シズル（バレンタイン）", "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 109102, 1, "2030/12/17 14:59:59", 0.0, 9, 1, "2019/01/31 12:00:00", 0.0, 10011, 24, 24019, 0, "シズル（バレンタイン）", "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 109102, 1, "2030/12/17 14:59:59", 0.0, 10, 1, "2019/01/31 12:00:00", 0.0, 10011, 24, 24020, 0, "シズル（バレンタイン）", "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 106401, 1, "2030/12/17 14:59:59", 0.0, 1, 2, "2015/12/17 15:00:00", -363.0, 0, 26, 26001, 2104010, "シェフィ", "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 105801, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 26, 26002, 0, "ペコリーヌ", "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 106001, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 26, 26003, 0, "キャル", "この先は神聖な場所みたい。\n手に入るお宝も並じゃないけど\n気を付けていかないと\n痛い目にあうわよ");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 105901, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 26, 26004, 0, "コッコロ", "ここから先は神聖な場所\nでございます。\n気を引き締めてお宝の\n調査探索に参りましょう");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 106401, 1, "2030/12/17 14:59:59", 0.0, 1, 2, "2015/12/17 15:00:00", -363.0, 0, 27, 27001, 2104010, "シェフィ", "ここにさらなる力を得るための\nアイテムが眠っている…って\nみんな言ってるわ。ふふっ、\nそれじゃあ挑戦してみましょうか");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 105801, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 27, 27002, 0, "ペコリーヌ", "ここにさらなる力を得るための\nアイテムが眠っているみたい\nです！　どこから挑戦するか\n迷っちゃいますね！");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 106001, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 27, 27003, 0, "キャル", "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 105901, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 27, 27004, 0, "コッコロ", "こちらにさらなる力を得る\nためのアイテムが眠っている\nようです。主さま、どこから\n挑戦いたしましょう。");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 190801, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2019/09/24 15:00:00", -363.0, 0, 28, 28001, 0, "カリン", "ようこそ！\n皆さんの素敵な出会いを\nギルド管理協会が\nお手伝いします！");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 190801, 1, "2030/12/17 14:59:59", 0.0, 2, 1, "2019/09/24 15:00:00", -363.0, 0, 28, 28002, 0, "カリン", "ギルド管理協会です\nフレンドに関しては\nこちらでご確認ください");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 190801, 1, "2030/12/17 14:59:59", 0.0, 3, 1, "2019/09/24 15:00:00", -409.0, 0, 29, 29001, 0, "カリン", "こちらがフレンドの\n皆さんです\n素敵な関係を\n築いてくださいね！");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 190801, 1, "2030/12/17 14:59:59", 0.0, 4, 1, "2019/09/24 15:00:00", -409.0, 0, 29, 29002, 0, "カリン", "こちらの一覧で\nフレンドのプロフィールを\n確認できますよ");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 190801, 1, "2030/12/17 14:59:59", 0.0, 5, 1, "2019/09/24 15:00:00", -409.0, 0, 30, 30001, 0, "カリン", "フレンド管理は\nこちらになります\n新しいフレンドとの出会いを\n楽しんでくださいね！");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 190801, 1, "2030/12/17 14:59:59", 0.0, 6, 1, "2019/09/24 15:00:00", -409.0, 0, 30, 30002, 0, "カリン", "フレンドの申請や\n承認ができますよ\nどうぞ、良き交流を！");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 190801, 1, "2030/12/17 14:59:59", 0.0, 7, 1, "2019/10/31 12:00:00", -409.0, 0, 31, 31001, 0, "カリン", "バトルをして力比べを\nしてみましょう！\n実力が試されますね、\n頑張ってください！");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 190801, 1, "2030/12/17 14:59:59", 0.0, 8, 1, "2019/10/31 12:00:00", -409.0, 0, 31, 31002, 0, "カリン", "気になるパーティと\nバトルをしてみましょう！\nどちらが勝利するのか、\n私も楽しみにしていますね");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 190801, 1, "2020/01/04 4:59:59", 0.0, 1, 1, "2019/12/20 5:00:00", -409.0, 0, 32, 32001, 0, "カリン", "ルーキーの皆さんのために\n特別なミッションを\nご用意いたしました！\nぜひ、挑戦してください！");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 190801, 1, "2020/01/04 4:59:59", 0.0, 2, 1, "2019/12/20 5:00:00", -409.0, 0, 32, 32002, 0, "カリン", "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 190801, 1, "2020/01/04 4:59:59", 0.0, 3, 1, "2019/12/20 5:00:00", -409.0, 0, 33, 33001, 0, "カリン", "フレンドになって\n初心者の方を応援しましょう！\n素敵な報酬が待っていますよ！");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 190801, 1, "2020/01/04 4:59:59", 0.0, 4, 1, "2019/12/20 5:00:00", -409.0, 0, 33, 33002, 0, "カリン", "期間限定のキャンペーンを\n開催中です！\nミッションにチャレンジ\nしましょう！");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 190801, 1, "2020/01/10 11:59:59", 0.0, 5, 1, "2020/01/04 5:00:00", -409.0, 0, 34, 34001, 0, "カリン", "お疲れ様でした！\nミッションの報酬の受け取りは\nこちらからできますよ！");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 190801, 1, "2020/01/10 11:59:59", 0.0, 6, 1, "2020/01/04 5:00:00", -409.0, 0, 34, 34002, 0, "カリン", "ミッション報酬の受け取りは\nこちら！\n受け取り漏れの無いように\n気を付けてくださいね！");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 105801, 2, "2030/12/17 14:59:59", 5.3, 1, 1, "2015/12/17 15:00:00", -458.0, 0, 38, 38001, 0, "ペコリーヌ", "過去のストーリーイベントを\n楽しめちゃいますよ！\n遊んだことのないものがあれば\n一緒にやってみましょう♪");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 105801, 2, "2030/12/17 14:59:59", 6.5, 2, 1, "2015/12/17 15:00:00", -458.0, 0, 38, 38002, 0, "ペコリーヌ", "これまでのイベントで登場した\n限定キャラを仲間にできたり\nメモリーピースが手に入る\nみたいですよ。やばいですね☆");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (9999.0, 105801, 3, "2020/04/08 23:59:59", 0.0, 0, 3, "2020/04/01", 9999.0, 0, 39, 39005, 0, "ペコリーヌ", "");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 190801, 1, "2030/12/17 14:59:59", 0.0, 2, 1, "2015/12/17 15:00:00", -430.0, 0, 40, 40001, 0, "カリン", "これまでに出題された\n問題を振り返ることが\nできますよ\n復習は大切です♪");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 106401, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 41, 41001, 2104010, "シェフィ", "ここでは腕試しが\nできるんですって。\n自分の実力を測るのに、\nちょうどよさそうね。");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 105801, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 41, 41002, 0, "ペコリーヌ", "ここで腕試しを\nしていきましょう！\n全力全開、\nがんばっちゃいますよ～！");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 106001, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 41, 41003, 0, "キャル", "ここで腕試しが\nできるみたいね。\n試してみるのも\nいいんじゃない？");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 105901, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 41, 41004, 0, "コッコロ", "腕試しができるようです。\nここで練習を重ね、実戦に\n活かしてまいりましょう。");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 105901, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -416.5, 0, 42, 42001, 0, "コッコロ", "訓練の成果に応じて、\n報酬がもらえるそうです。\n共に励んでいきましょう。");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 106401, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -416.5, 0, 42, 42002, 2104010, "シェフィ", "目標を達成すれば、\n報酬がもらえるみたい。\n頑張り甲斐があるわね。");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 105801, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -416.5, 0, 42, 42003, 0, "ペコリーヌ", "腕試しをがんばれば、\n報酬がもらえますよ。\n挑戦していきましょう☆");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 106001, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -416.5, 0, 42, 42004, 0, "キャル", "ミッションを達成すると、\n報酬が出るんですって。\n一緒にやってみましょ！");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 105801, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 43, 43001, 0, "ペコリーヌ", "ここからアリーナに\n挑戦できますよ！\n編成を工夫してライバルに\n挑んじゃいましょう！");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 105901, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 43, 43002, 0, "コッコロ", "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 106001, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -363.0, 0, 43, 43003, 0, "キャル", "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 123001, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -416.5, 0, 44, 43004, 0, "アメス", "ミッションをクリアすると報酬が\n受け取れるわ。ジャンジャン\nクリアしてバリバリ強化して\nあげなさい♪");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 123001, 1, "2030/12/17 14:59:59", 0.0, 2, 1, "2015/12/17 15:00:00", -416.5, 0, 44, 43005, 0, "アメス", "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 123001, 2, "2030/12/17 14:59:59", 5.79, 3, 1, "2015/12/17 15:00:00", -416.5, 0, 45, 43006, 0, "アメス", "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 123001, 1, "2030/12/17 14:59:59", 0.0, 1, 1, "2015/12/17 15:00:00", -371.5, 0, 46, 46001, 0, "アメス", "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 104901, 2, "2030/12/17 14:59:59", 0.0, 1, 2, "2015/12/17 15:00:00", -416.5, 0, 47, 47001, 0, "シズル", "呼ばれて飛び出てお姉ちゃんだよ♪\nたとえ火の中、水の中、迷宮の中っ\nこのダンジョンを踏破できるよう\n弟くんを応援してあげるからねっ♪");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 101101, 2, "2030/12/17 14:59:59", 9.32, 1, 1, "2015/12/17 15:00:00", -416.5, 0, 47, 47002, 0, "リノ", "ほんとーに不思議な場所ですね～\nお兄ちゃんが冒険を頑張れるよう\nおまじないをかけてあげますねっ\nフレーフレー、お・兄・ちゃんっ♪");
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 104901, 2, "2030/12/17 14:59:59", 0.0, 0, 2, "2015/12/17 15:00:00", -470.0, 0, 48, 48001, 0, "シズル", "");
